__NUXT_JSONP__("/drugs/Foslinanib_Disodium", (function(a,b,c,d){return {data:[{drug:{slug:a,emaEpar:[],fdaDrugLabel:[],id:a,nciThesaurus:{casRegistry:"1256037-62-3",chebiId:b,chemicalFormula:b,definition:"The disodium salt form of foslinanib, an orally bioavailable agent with potential antineoplastic and anti-vasculogenic mimicry activities. Upon oral administration, foslinanib targets and inhibits the formation of vasculogenic mimicry (VM; vascular mimicry). By destroying the VM channels and network, cancer cells are devoid of perfusion leading to an induction of cancer cell apoptosis and inhibition of cancer cell proliferation. VM is associated with tumor metastasis.",fdaUniiCode:"8X5F5LAF7B",identifier:"C163994",preferredName:c,semanticType:"Pharmacologic Substance",subclassOf:["C1742"],synonyms:["4(1H)-Quinolinone, 2-(3-Fluorophenyl)-6-methoxy-5-(phosphonooxy)-, Sodium Salt (1:2)","CVM-1118 Disodium","FOSLINANIB DISODIUM",c,"TRX-818","TRX818 Disodium"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FFoslinanib_Disodium",extension:".json",createdAt:d,updatedAt:d}}],fetch:{},mutations:void 0}}("Foslinanib_Disodium","","Foslinanib Disodium","2021-10-30T13:35:38.573Z")));